$.ak4=function(){var t=u.X
return P.A(["en","Studying Numbers was born from the concept of cards, where a word is presented on one side of the card and the meaning on the other. There are some apps that propose to do this with words and phrases, mostly you are the one who assembles the cards.\nStudying Numbers, since it is exclusively aimed at numbers, the cards are automatic and the option of several languages \u200b\u200ballows you to expand your linguistic knowledge.\nRandomly Studying Numbers presents you with the spelling of a numeral, in the selected language, for you to enter the number (numeric digits). In this process, the correct number is presented in your writing and in your pronunciation.\nFor a bigger challenge, you can invert the presentation, that is, Studying Number presents the numeral for you to write the spelling of it.\nIn both cases, contact with the language, it's writing, and pronunciation helped him to get used to reading the spelling and hearing the pronunciation, identifying, by repetition, the differences between decimal, hundreds, and other scales.\n \n  ","pt","O Studying Numbers nasceu do conceito de cart\xf5es, onde em um lado do cart\xe3o \xe9 apresentado uma palavra e do outro o significado. H\xe1 alguns aplicativos que se prop\xf5em a fazer isto com palavras e frases, em sua maioria \xe9 voc\xea quem monta os cart\xf5es.\nO Studying Numbers, por ser voltado exclusivamente para n\xfameros, os cart\xf5es s\xe3o autom\xe1ticos e a op\xe7\xe3o de v\xe1rios idiomas lhe permite ampliar seus conhecimentos lingu\xedsticos.\nDe forma aleatoriamente o Studying Numbers lhe apresenta a grafia de um numeral, no idioma selecionado, para voc\xea digitar o n\xfamero (algarismos num\xe9ricos). Neste processo o n\xfamero correto \xe9 apresentado em sua foram escrita e em sua pronuncia.\nPara um desafio maior, pode-se inverter a apresenta\xe7\xe3o, ou seja, o Studying Number lhe apresenta o numeral para voc\xea escrever a grafia do mesmo.\nEm ambos os casos, o contato com o idioma, sua escrita e pronuncia lhe ajudaram a acostumar a ler a grafia e ouvir a pronuncia, identificando, por repeti\xe7\xe3o, as diferen\xe7as entre numerais decimais, centesimais e outras escalas.\n\n  "],t,t)}()
