$.ak7=function(){var t=u.X
return P.A(["en","Possibly the habit of counting every 10 out of 10 in the number of fingers on our hands. In a primitive scenario, fingers are the first way to record a quantity and even today we use fingers as a tool to assist in counting.\nCounting 10 out of 10 is known as a decimal base system, as 10 symbols are required to represent a number.\n\n  ","pt","Possivelmente o habito de se contar de 10 em 10 em origem na quantidade de dedos de nossas m\xe3os. Em um cen\xe1rio primitivo, os dedos representam a primeira forma de registrar uma quantidade e at\xe9 hoje utilizamos os dedos como ferramenta para auxiliar nas contagens.\nO contar de 10 em 10 \xe9 conhecido como sistema decimal ou de base 10, pois s\xe3o necess\xe1rios 10 s\xedmbolos para representar um n\xfamero.\n\n  "],t,t)}()
